import React from "react";

import {GuestGreeting, UserGreeting} from "./Greeting_users";

function Greeting(props){
    const isLoggedIn = props.isLoggedIn;
    if (isLoggedIn){
        return <UserGreeting />;
    }
    return <GuestGreeting />;
}

export default Greeting
